import React, { Component } from 'react';

export default class Explanation extends Component {
  render() {
    if (this.props.currPage === 'detox') {
      console.log(1);
    } else if (this.props.currPage === 'powder') {
      console.log(2);
    } else {
      console.log(3);
    }
  }
}
